  [],\n\t\"revision_timestamp\": \"2015-05-07T01:12:13.864702\",\n\t\"name\": \"optical-navigation-system-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This proposal is for a flexible navigation
  system for deep space operations that does not require rnGPS measurements. The navigation
  solution is computed using an Unscented Kalman Filter that rncan accept any combination
  of range, range-rate, planet chordwidth, and angle measurements using any celestial
  object. The UKF employs a full nonlinear dynamical model of the orbit including
  gravity models and disturbance models. The filter will estimate both states and
  parameters. The integrated system employs a sensor measures solar chordwidths and
  angles between planets, stars and the sun vector.rnrnThe proposed sensor is is called
  the Twin Quad Sensor (TQS). Two independently gimbaled telescopes  each with a zoom
  lens comprise the sensor. The sensor includes redundant processors and data networks
  to provide a high degree of fault tolerance in a single package.  The focal plane
  of each telescope uses four 256 by 256 pixel arrays. These are used to measure the
  chord width of the Sun, angles between planets and angles to stars. In addition
  each telescope can be used independently and the angles between planets or to stars
  can be measured by high accuracy angle resolvers.\",\n\t\"license_title\": \"U.S.
